import React from 'react';

const SponsorCard = props => {
    console.log(props);
    return <a href={props.link}>
        <div>
            <div class="sponsor-logo">
                <img src={props.logo} />
            </div>
            <div class="sponsor-name">
                <img src={props.name} />
            </div>
        </div>
    </a>
}

export default SponsorCard;
